TESTUSER_USERNAME = "testuser";
TESTUSER_EMAIL = "testemail@mail.com";
TESTUSER_PASSWORD = "password";
OTHERUSER_USERNAME = "otheruser";
OTHERUSER_EMAIL = "other@mail.com";
OTHERUSER_PASSWORD = "otherpassword";

AUTH_TOKEN_PREFIX = "Knox ";
INCORRECT_TOKEN = "1234";
TEST_IMAGE_FILE = ""
TEST_VIDEO_FILE = ""

from core.common import DEFAULT_ALBUM, MediaKinds

from rest_framework.test import APITestCase

# Register the testuser by default, but registers any user if credentials are provided
def register_user(self: APITestCase, username=TESTUSER_USERNAME, password=TESTUSER_PASSWORD, email=TESTUSER_EMAIL):
    url = reverse('register')
    user = {
        "username": username,
        "password": password,
        "email": email,
    }
    response = self.client.post(url, user)
    self.assertEqual(response.status_code, status.HTTP_201_CREATED)
    data = response.json()
    self.assertTrue('username' in data)
    self.assertEqual(data['username'], username)
    self.assertTrue('email' in data)
    self.assertEqual(data['email'], email)

# Logs in the testuser by default, but logs in any user if credentials are provided
def login_user(self: APITestCase, username=TESTUSER_USERNAME, password=TESTUSER_PASSWORD, email=None):
    url = reverse('login')
    if email is None:
        user = {
            "username": username,
            "password": password
        }
    else:
        user = {
            "email": email,
            "password": password
        }
    response = self.client.post(url, user)
    self.assertEqual(response.status_code, status.HTTP_200_OK)
    data = response.json()
    self.assertTrue('token' in data)
    self.client.credentials(HTTP_AUTHORIZATION=AUTH_TOKEN_PREFIX + data['token'])
    
    
# Adds a new album to the current user
def put_album(self: APITestCase, albumname: str | dict):
    url = reverse('album')
    if isinstance(albumname, str):
        album = {
            "name": albumname,
        }
    else:
        album = albumname
    response = self.client.put(url, album)
    self.assertEqual(response.status_code, status.HTTP_201_CREATED)
    data = response.json()
    self.assertTrue('name' in data)
    self.assertEqual(data['name'], album['name'])
    self.assertTrue('id' in data)
    check_album(self, data, album)
    return data

# Adds a new media to the current user
def put_media(self: APITestCase, media, albumid=None):
    url = reverse('media')  
    if albumid is not None:
        media['albumid'] = albumid
    response = self.client.put(url, media)
    self.assertIn(response.status_code, [status.HTTP_201_CREATED, status.HTTP_200_OK])
    data = response.json()
    check_media(self, data, media)
    return data


def check_album(self: APITestCase, responsedata, album):
    self.assertTrue('id' in responsedata)
    if 'id' in album:
        self.assertTrue(responsedata['id'] == album['id'])
    
    self.assertTrue('name' in responsedata)
    if 'name' in album:
        self.assertTrue(responsedata['name'] == album['name'])
    
    self.assertTrue('creationdate' in responsedata)
    self.assertTrue('lastupdate' in responsedata)
    
    
    
def check_media(self, responsedata, media=None):
    if media is None:
        media = self.CORRECT_MEDIA
        
    self.assertTrue('id' in responsedata)
    if 'id' in media:
        self.assertTrue(responsedata['id'] == media['id'])
        
    self.assertTrue('kind' in responsedata)
    if 'kind' in media:
        self.assertTrue(responsedata['kind'] == media['kind'])
    
    self.assertTrue('filename' in responsedata)
    if 'filename' in media:
        self.assertTrue(responsedata['filename'] == media['filename'])
    
    self.assertTrue('location' in responsedata)
    if 'location' in media:
        self.assertTrue(responsedata['location'] == media['location'])
    
    self.assertTrue('label' in responsedata)
    if 'label' in media:
        self.assertTrue(responsedata['label'] == media['label'])
    
    self.assertTrue('detectedobjects' in responsedata)
    if 'detectedobjects' in media:
        self.assertTrue(responsedata['detectedobjects'] == media['detectedobjects'])
    
    if 'file' in media and 'file' in responsedata:
        self.assertTrue(responsedata['file'] == media['file'])
    
    self.assertTrue('modificationdate' in responsedata)
    if 'modificationdate' in media:
        self.assertTrue(responsedata['modificationdate'] == media['modificationdate'])        
    
    
def setup_users_albums_media(self: APITestCase):        
    # Register and login other user
    register_user(self, username=OTHERUSER_USERNAME, password=OTHERUSER_PASSWORD, email=OTHERUSER_EMAIL)
    login_user(self, username=OTHERUSER_USERNAME, password=OTHERUSER_PASSWORD)
    
    # Create other user album
    album = {
        "name": "album"
    }
    self.INCORRECT_ALBUM = put_album(self, album)
    
    # Put media
    data = {
        "kind": MediaKinds.IMAGE.value,
        "file": TEST_IMAGE_FILE,
    }
    self.INCORRECT_MEDIA = put_media(self, data, self.INCORRECT_ALBUM['id'])
    
    # Register and login testuser
    register_user(self)
    login_user(self)
    
    # Create testuser album and put media
    testalbum = {
        "name": "testalbum"
    }
    self.CORRECT_ALBUM = put_album(self, testalbum)
    
    media = {
        "kind": MediaKinds.IMAGE.value,
        "file": TEST_IMAGE_FILE,
        "albumid": self.CORRECT_ALBUM['id']
    }
    self.CORRECT_MEDIA = put_media(self, media, self.CORRECT_ALBUM['id'])
    
    
def get_default_album(self: APITestCase):
    url = reverse('album')
    response = self.client.get(url)
    self.assertEqual(response.status_code, status.HTTP_200_OK)
    data = response.json()
    self.assertTrue('id' in data)
    self.assertTrue('name' in data)
    self.assertTrue(data['name'] == DEFAULT_ALBUM)
    return data
    

